import React, { useState, useEffect } from "react";
import Card from "../shared/UIElements/Card";
const SearchResults = ({ searchList }) => {
  return (
    <div className="Container">
      {searchList.map((item) => (
        <div>{item.reposid}</div>
      ))}
    </div>
  );
};

export default SearchResults;
